              "},{"nodeType":1,"id":627,"tagName":"SCRIPT","attributes":{},"childNodes":[{"nodeType":3,"id":628,"textContent":"
                document.addEventListener('DOMContentLoaded', function() {
                  const addToCartButton = document.getElementById('add-to-cart');
                  const upsellContainer = document.querySelector('.upsell-container');

                  if (addToCartButton && upsellContainer) {
                    addToCartButton.addEventListener('click', function(event) {
                      event.preventDefault();

                      const variantId = event.target.getAttribute('data-variant-id');
                      const formData = new FormData();
                      formData.append('id', variantId);
                      formData.append('quantity', 1);

                      fetch('/cart/add.js', {
                        method: 'POST',
                        body: formData,
                        credentials: 'same-origin',
                        headers: {
                          'X-Requested-With': 'XMLHttpRequest'
                        }
                      })
                      .then(response => response.json())
                      .then(data => {
                        console.log('Product added to cart:', data);
                        window.carts.map((cart) => {
                          cart.onCartUpdated(variantId);
                        });
                        console.log('display value changed');
                      })
                      .catch(error => {
                        console.error('Error adding product to cart:', error);
                      });
                    });
                  }
                });
              "}]},{"nodeType":3,"id":629,"textContent":"

